import{_ as e,c as s,o as a,a as n}from"./app.fb687074.js";const g=JSON.parse('{"title":"在linux-deepin上使用deepin-wine5完美运行腾讯会议/QQ/微信等此类应用","description":"","frontmatter":{"title":"在linux-deepin上使用deepin-wine5完美运行腾讯会议/QQ/微信等此类应用","date":"2021-05-20T00:00:00.000Z","tags":["技术笔记","技术教程"],"categories":["技术笔记"]},"headers":[{"level":2,"title":"效果","slug":"效果","link":"#效果","children":[]},{"level":2,"title":"开始","slug":"开始","link":"#开始","children":[{"level":3,"title":"安装deepin-wine5","slug":"安装deepin-wine5","link":"#安装deepin-wine5","children":[]},{"level":3,"title":"安装腾讯会议","slug":"安装腾讯会议","link":"#安装腾讯会议","children":[]}]},{"level":2,"title":"QA","slug":"qa","link":"#qa","children":[{"level":3,"title":"没有运行的图标","slug":"没有运行的图标","link":"#没有运行的图标","children":[]}]},{"level":2,"title":"参考","slug":"参考","link":"#参考","children":[]}],"relativePath":"pages/technology/learn/deepin-wemeet.md","lastUpdated":1678974252000}'),p={name:"pages/technology/learn/deepin-wemeet.md"},l=n(`<h1 id="在linux-deepin上使用deepin-wine5完美运行腾讯会议-qq-微信等此类应用" tabindex="-1">在linux-deepin上使用deepin-wine5完美运行腾讯会议/QQ/微信等此类应用 <a class="header-anchor" href="#在linux-deepin上使用deepin-wine5完美运行腾讯会议-qq-微信等此类应用" aria-hidden="true">#</a></h1><h2 id="效果" tabindex="-1">效果 <a class="header-anchor" href="#效果" aria-hidden="true">#</a></h2><p>捣鼓了一下午，终于把腾讯会议整好了</p><p>咱先上效果免得说骗人</p><p><img src="https://img.cdn.sugarat.top/mdImg/MTYyMTUyNDAxNTE2NA==621524015164" alt="图片"></p><ul><li>腾讯会议:支持屏幕共享、语音、录屏等等</li><li>QQ/微信:常用功能均可用</li></ul><p>笔者是用的deepin-15.11，如果是其它linux发行版，请先安装deepin-wine5</p><p>如果是deepin用户，先看看是否有deepin-wine5环境</p><p><img src="https://img.cdn.sugarat.top/mdImg/MTYyMTUyNDI0Mzk1NA==621524243954" alt="图片"></p><p>没试用过其它发行版，各位如不是deepin，不妨也可试试看</p><h2 id="开始" tabindex="-1">开始 <a class="header-anchor" href="#开始" aria-hidden="true">#</a></h2><h3 id="安装deepin-wine5" tabindex="-1">安装deepin-wine5 <a class="header-anchor" href="#安装deepin-wine5" aria-hidden="true">#</a></h3><p>添加源</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#FFCB6B;">sudo</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">vim</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">/etc/apt/sources.list</span></span>
<span class="line"></span></code></pre></div><p>加入下述内容</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#FFCB6B;">deb</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">[</span><span style="color:#A6ACCD;">by-hash</span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;">force</span><span style="color:#89DDFF;">]</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">https://community-packages.deepin.com/deepin/</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">apricot</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">main</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">contrib</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">non-free</span></span>
<span class="line"></span></code></pre></div><p><img src="https://img.cdn.sugarat.top/mdImg/MTYyMTUyNDQyODMyMA==621524428320" alt="图片"></p><p>更新源</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#FFCB6B;">sudo</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">apt</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">update</span></span>
<span class="line"></span></code></pre></div><p>安装deepin-wine5</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#FFCB6B;">sudo</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">apt</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">install</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">deepin-wine5</span></span>
<span class="line"></span></code></pre></div><p>安装完后,查看是否安装成功</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#FFCB6B;">deepin-wine5</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">--version</span></span>
<span class="line"></span></code></pre></div><h3 id="安装腾讯会议" tabindex="-1">安装腾讯会议 <a class="header-anchor" href="#安装腾讯会议" aria-hidden="true">#</a></h3><p>添加deepin-wine移植的仓库地址</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#FFCB6B;">wget</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-O-</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">https://deepin-wine.i-m.dev/setup.sh</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;"> </span><span style="color:#FFCB6B;">sh</span></span>
<span class="line"></span></code></pre></div><p>更新源信息</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#FFCB6B;">sudo</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">apt-get</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">update</span></span>
<span class="line"></span></code></pre></div><p>安装腾讯会议</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#FFCB6B;">sudo</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">apt-get</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">install</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">com.tencent.meeting.deepin</span></span>
<span class="line"></span></code></pre></div><p>其它应用的名称请前往 <a href="https://deepin-wine.i-m.dev/" target="_blank" rel="noreferrer">此链接</a> 查看，如：</p><ul><li>QQ：com.qq.im.deepin</li><li>微信：com.qq.weixin.deepin</li></ul><p>大工告成，<strong>重启一下系统</strong>就找到菜单中的相应的运行图标了</p><h2 id="qa" tabindex="-1">QA <a class="header-anchor" href="#qa" aria-hidden="true">#</a></h2><h3 id="没有运行的图标" tabindex="-1">没有运行的图标 <a class="header-anchor" href="#没有运行的图标" aria-hidden="true">#</a></h3><p>如重启系统仍然在菜单中找不到，那采用手动的方式</p><p>手动进入安装目录</p><p>记得<strong>替换user</strong>为你自己的用户名</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#FFCB6B;">/home/user/.deepinwine/Deepin-WeMeet/drive_c/Program</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">Files/Tencent/WeMeet</span></span>
<span class="line"></span></code></pre></div><p>运行</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#FFCB6B;">deepin-wine5</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">wemeetapp.exe</span></span>
<span class="line"></span></code></pre></div><p><img src="https://img.cdn.sugarat.top/mdImg/MTYyMTUyNTEzNTA3OA==621525135078" alt="图片"></p><p>如果过程中遇到问题的老哥，欢迎评论区交流</p><h2 id="参考" tabindex="-1">参考 <a class="header-anchor" href="#参考" aria-hidden="true">#</a></h2><ul><li><a href="https://github.com/zq1997/deepin-wine" target="_blank" rel="noreferrer">Github:zq1997/deepin-wine</a></li><li><a href="https://www.jianshu.com/p/6740f6c73033" target="_blank" rel="noreferrer">简书:记录完整的在Ubuntu 20.04下使用deepin-wine5安装微信3.0的过程</a></li></ul>`,45),t=[l];function i(o,c,r,d,h,C){return a(),s("div",null,t)}const u=e(p,[["render",i]]);export{g as __pageData,u as default};
